import { withRouter } from 'next/router'
import Comp from '../components/comp'


const A = ({router})=>{
    return (
        <span>
            {console.log(router.query)}
            <Comp>AAA get id= '{router.query.id}'.</Comp>
        </span>
    )
}

export default withRouter(A)
